package com.example.recyclerviewkotlin

import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import android.widget.GridLayout
import androidx.core.content.ContentProviderCompat.requireContext
import androidx.recyclerview.widget.GridLayoutManager
import com.example.RecyclerViewKotlin.databinding.FragmentMainBinding


class MainFragment : Fragment() {
    private lateinit var binding: FragmentMainBinding
    private val data = arrayListOf<LessonModel>()

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        binding = .inflate(LayoutInflater.from(requireContext()), container, false)
        return binding.root
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        loadData()
        val adapter = LessonAdapter(data)
        binding.recycler.adapter = adapter
        binding.recycler.layoutManager = GridLayoutManager(requireContext(), 3)

    }

    private fun loadData() {
        data.add(LessonModel("https://www.mooc.org/hubfs/history.jpg", "History"

        ))
        data.add(LessonModel("https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTWcH3UOF9wo89fM87rCzAM9Rrd0uuVNlEbzQ&usqp=CAU", "Biology"
        ))
        data.add(
            LessonModel("data:image/jpeg;base64,", "Social Science"
            )
        )
        data.add(LessonModel("data:image/jpeg;base64,", "Mathematic"
        ))
        data.add(LessonModel("data:image/jpeg;base64,", "Russian Language"
        ))
        data.add(LessonModel("data:image/png;base64,", "English"
        ))
        data.add(LessonModel("data:image/jpeg;base64,", "frog"
        ))
    }


}